import "./App.css";

function App() {
  const [time, setTime] = React.useState(new Date().toLocaleDateString());

  React.useEffect(function () {
    setInterval(function () {
      setTime(new Date().toLocaleTimeString());
    }, 1000);
  }, []);

  return <div className="App">Hello World</div>;
}

export default App;
